INSERT INTO `faqs` (`id`, `question`, `answer`, `status`, `created_at`, `updated_at`) VALUES
(4, 'What is VERGECAD ?', 'VERGECAD is Automated building design engine , where user can define required building parameters , and get full building design model according to his parameters .', 0, '2022-09-20 05:12:01', '2022-09-20 05:12:01'),
(5, 'Does VERGECAD need modeling skills ?', 'No need for any modeling skills, VERGECAD only requires the data to be provided by the user , like room types, number of floors , building area, plot area ...etc.', 0, '2022-09-20 05:12:19', '2022-09-29 23:36:06'),
(6, 'Who can use VERGECAD ?', 'VERGECAD  can be used by Architects, Contractors, Real estate developers, game developers, Metaverse makers , or anyone who needs a 3D building design using parameters only without any modeling effort.', 0, '2022-09-20 05:12:34', '2022-09-29 23:39:34');
