INSERT INTO `pages` (`id`, `title`, `logo`, `feature_content`, `faq_content`, `support_content`, `landing_content`, `created_at`, `updated_at`) VALUES
(1, 'VergeCAD', 'storage/logo.png', '<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><img src=\"/public/ckfinder/files/image-20220427033019-1.png\" style=\"height:715px; width:1273px\" /></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<h1 dir=\"ltr\">&nbsp;</h1>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>', '<div dir=\"ltr\">\r\n<h1>&nbsp;</h1>\r\n\r\n<p><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:22px\"><span style=\"font-family:Calibri\"><span style=\"color:#3498db\">What is VERGECAD ?&nbsp;</span></span></span></p>\r\n\r\n<p><span style=\"font-size:22px\"><span style=\"font-family:Calibri\">VERGECAD is Automated&nbsp; building design engine , where user can define required building parameters , and get&nbsp; full building design model according to his parameters .</span></span></p>\r\n</div>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-size:22px\"><span style=\"font-family:Calibri\"><span style=\"color:#3498db\">Does VERGECAD&nbsp; need modeling skills ?</span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-size:22px\"><span style=\"font-family:Calibri\">No need for any skills , VERGECAD requires the user only to insert his building requirements like rooms types, number of floors, building area , plot area ,...etc.</span></span></p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-size:22px\"><span style=\"font-family:Calibri\"><span style=\"color:#3498db\">Who can use VERGECAD ?</span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-size:22px\"><span style=\"font-family:Calibri\">VERGECAD can be used by Architects , Realestate developers , Contractors , game developers , metaverse makers , or any user need to have 3d building design using parameters only without any modeling effort .</span></span></p>', '<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<h2 dir=\"ltr\"><span style=\"color:#3498db\">Are you interested to be one of our 100 first users?&nbsp;</span></h2>\r\n\r\n<div dir=\"ltr\"><big>Please, tell us more about you to understand if Vergecad&nbsp; is the right fit.</big></div>\r\n\r\n<div dir=\"ltr\"><big>please drop us an email to the following address :</big></div>\r\n\r\n<div dir=\"ltr\"><big>info@vergecad.com</big></div>', '<h1 dir=\"ltr\">&nbsp; &nbsp; &nbsp; <img src=\"/public/ckfinder/files/image-20220428131112-1.png\" style=\"height:95px; width:211px\" />&nbsp;</h1>', '2022-03-08 06:55:56', '2022-03-08 06:55:56');
